    false,nt"url": null,nt"notes": "This report summarizes the results of a
    banding project on Long Lake in 1965. The dates at the banding site were July 27th
    through August 8th. As in the past, the objective was to drive several thousand
    divers which are predominantly scaup and old squaw into a large holding pen. The
    ducks would then be brailled from a catch pen into burlap bags and banded.",nt"license_title":
